// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/523794/Everything%E9%80%89%E6%8B%A9%E6%96%87%E6%9C%AC%E5%90%8E%E5%B1%95%E7%A4%BA%E6%8C%89%E9%92%AE.user.js
// @updateURL https://update.greasyfork.org/scripts/523794/Everything%E9%80%89%E6%8B%A9%E6%96%87%E6%9C%AC%E5%90%8E%E5%B1%95%E7%A4%BA%E6%8C%89%E9%92%AE.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Create a button element
    const button = document.createElement('button');
    button.style.position = 'absolute';
    button.style.display = 'none';//初始状态下，按钮不会显示在页面上
    button.style.zIndex = '1000';//设置按钮的 z-index，为其在堆叠上下文中的显示顺序。较大的值将使按钮在上层显示
    button.style.cursor = 'pointer';//当用户将鼠标悬停在按钮上时，光标将变为手指形状，表示该按钮是可点击的
    button.style.width = '45px'; // 设置按钮的宽度，这里设为 45 像素，适合显示图标
    button.style.height = '45px'; // 设置按钮的高度，这里设为 45 像素，适合显示图标
    button.style.backgroundColor = 'transparent'; //设置按钮背景色为透明
    button.style.border = 'none';// 移除按钮的边框
    button.style.borderRadius = '10px';//设置按钮的边角为 10 像素的圆角，使其看起来更平滑
    //设置按钮的背景图像
    button.style.backgroundImage = 'url(data:image/png;base64,)';
    button.style.backgroundSize = '90px 90px'; // 设置背景图像的大小为 90 像素宽和 90 像素高
    button.style.backgroundRepeat = 'no-repeat';//设置背景图像不重复
    button.style.backgroundPosition = 'center';//将背景图像的位置设置为居中

    // 使用 MutationObserver 监控 DOM 变化
    const observer = new MutationObserver((mutations, obs) => {
        if (!button.parentElement) {
            document.body.appendChild(button);
            obs.disconnect();
        }
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });

    // 改进后的 mouseup 事件处理函数
    document.addEventListener('mouseup', function(event) {
        const selection = window.getSelection();
        const selectedText = selection.toString().trim();

        if (selectedText) {
            const range = selection.getRangeAt(0);
            const rect = range.getBoundingClientRect();
            const container = range.commonAncestorContainer;

            if (!isInsideScbar(container)) {
                if (rect.width > 0 && rect.height > 0) {
                    button.style.top = `${rect.top + window.scrollY}px`;
                    button.style.left = `${rect.right + window.scrollX + 1}px`;
                    button.style.display = 'block';
                    button.dataset.selectedText = selectedText;
                }
            } else {
                button.style.display = 'none';
            }
        } else {
            button.style.display = 'none';
        }
    });

    // 使用节流函数优化 mousedown 事件
    let lastClickTime = 0;
    const handleClick = function(event) {
        const currentTime = new Date().getTime();
        if (currentTime - lastClickTime > 500) {
            if (event.target !== button) {
                button.style.display = 'none';
            }
            lastClickTime = currentTime;
        }
    };

    document.addEventListener('mousedown', handleClick);

    // 改进后的 isInsideScbar 函数
    function isInsideScbar(node) {
        while (node) {
            if (node.id === 'scbar' ||
                node.id === 'J_duyaHdSearch' ||
                node.tagName === 'INPUT' ||
                node.tagName === 'TEXTAREA') {
                return true;
            }
            node = node.parentNode;
        }
        return false;
    }

    // 错误处理
    try {
        button.onclick = function() {
            const selectedText = this.dataset.selectedText;
            if (selectedText) {
                window.location.href = `es://${encodeURIComponent(selectedText)}`;
            }
            button.style.display = 'none';
        };
    } catch (error) {
        console.error(' 脚本执行失败:', error);
    }
})();